import React, { Component } from 'react';
import './About.css';
import eesa_icon from '../images/eesa-icon.png';
import { Link } from 'react-router-dom';
class About extends Component{
    render(){
        return (
        <div id="About_container">
            <div id = "About_space"></div>
            <div id="About_up">
                <h1 id="About_up_text">
                    Welcome to NTUEE+
                </h1>
            </div>
            <div id="About_down">
                <p id="About_down_text">
                    我們希望這個聯絡網能成為<br/>
                    一個整合式的社群網路，<br/>
                    讓NTUEErs聚在一起；<br/>
                    秉持著恢復人脈網的精神，<br/>
                    讓NTUEE能在世界上有更大的影響力；<br/>
                    建立一個連結電機系的共同回憶，<br/>
                    讓系友們有專屬的家！
                </p>
            </div>

            <Link id="About_btn_text" to="/Login">JOIN US</Link>

            {/* <div id="About_footer">
                    <img id="About_logo" src={eesa_icon} alt="logo" ></img>
                    <p id="About_footer_text">聯絡信箱 : ntueesa@gmail.com</p>
                    <p id="About_footer_text_2">台灣大學電機工程學系 系學會</p>
            </div> */}
        </div>
        )
    }
}

export default About;
